B.JC=new A.aq("\n\nAnts feed on rice seeds and seedlings.\n\nTheir feeding damage causes rice seeds or plants to be missing. It also affects plant stand and increases the incidence of diseases vectored by Homoptera insects such as planthoppers, leafhoppers, mealybugs, and aphids.",null,B.m,B.r)
B.b1=new A.aq("\n\nWhy And Where It Occurs",null,B.m,B.dz)
B.K_=new A.aq("\n\nAnts mainly occur in the upland fields where they nest below the soil surface. In rainfed wetland fields, they are confined to rice levees or bunds.\n\nAnts damage the field in patches. They usually feed on plants during the seedling stage.",null,B.m,B.r)
B.b2=new A.aq("\n\nHow To Identify",null,B.m,B.dz)
B.Jq=new A.aq("\n\nCheck for missing plants and loss of plant stand.\n\nThese damages are also similar to feeding symptoms of mole cricket. To distinguish, check for the presence of the insect.\n\nAnts are often found in damaged areas. Seeds may be found in their underground nests.",null,B.m,B.r)
B.b0=new A.aq("\n\nHow To Manage",null,B.m,B.dz)
B.K1=new A.aq("\n\n\u25cf To reduce the impact of ant damage, increase the seeding rate\n\n\u25cf Control ants by allowing natural enemies such as birds, snakes, bullfrogs, and ground lizards.\n\n\u25cf Compost tea and beneficial nematodes: Beneficial micro-organisms in the compost tea and in the gut of nematodes seem to be doing the actual control.\n\n\u25cf When ants encounter a fence or a wall they are likely to travel the course of the fence rather than up over the fence to forage on the other side. Physical barriers such as ant fences running parallel to the field periphery are partially successful in keeping ants out of the field.\n\n\n",null,B.m,B.r)
B.BD=A.b(s([B.bN,B.JC,B.b1,B.K_,B.b2,B.Jq,B.b0,B.K1]),t.R)
B.Jm=new A.aq(null,B.BD,B.m,null)
B.JY=new A.aq("\n\nRice hispa scrapes the upper surface of leaf blades leaving only the lower epidermis.\n\nIt also tunnels through the leaf tissues. When damage is severe, plants become less vigorous.",null,B.m,B.r)
B.Ja=new A.aq("\n\nThe presence of grassy weeds in and near rice fields as alternate hosts harbor and encourages the pest to develop. The heavily fertilized field also encourages damage.\n\nHeavy rains, especially in pre monsoon or earliest monsoon periods, followed by abnormally low precipitation, minimum day-night temperature differential for a number of days, and high RH are favorable for the insect\u2019s abundance.\n\nThe rice hispa is common in rainfed and irrigated wetland environments and is more abundant during the rainy season.",null,B.m,B.r)
B.Jb=new A.aq("\n\nCheck for feeding damage: \n\n\u25cf Scraping of the upper surface of the leaf blade leaving only the lower epidermis as white streaks parallel to the midrib\n\n\u25cf Irregular translucent white patches that are parallel to the leaf veins caused by tunneling of larvae through leaf tissue causes withering of damaged leaves and whitish and membranous leaves\n\n\u25cf Rice fields appear burnt when severely infested.\n\nHispa feeding damage is similar to feeding marks caused by flea beetles. To confirm cause of damage, check for insect presence, and the characteristic feeding marks: \n\n\u25cf Elongated, clear feeding marks\n\n\u25cf White streaks of uneaten lower epidermis between the parallel leaf veins",null,B.m,B.r)
B.Jw=new A.aq("\n\nA cultural control method that is recommended for the rice hispa is to avoid over fertilizing the field. Close plant spacing results in greater leaf densities that can tolerate higher hispa numbers. To prevent egg-laying of the pests, the shoot tips can be cut. Clipping and burying shoots in the mud can reduce grub populations by 75\u221292%.\n\nAmong the biological control agents, there are small wasps that attack the eggs and larvae. A reduviid bug eats upon the adults. There are three fungal pathogens that attack the adults.\n\n\n",null,B.m,B.r)
B.Cx=A.b(s([B.bN,B.JY,B.b1,B.Ja,B.b2,B.Jb,B.b0,B.Jw]),t.R)
B.Jn=new A.aq(null,B.Cx,B.m,null)
B.Jg=new A.aq("\n\nBoth adult and nymph mealybugs remove plant sap by sucking. This results in the curling of leaves and wilting of plants.",null,B.m,B.r)
B.JF=new A.aq("\n\nDry periods and the presence of grassy weeds that harbor this insect pest favor the population buildup of the rice mealybug. Likewise, well-drained soils are also suitable for insect pests.\n\nThe rice mealybug is found in upland and rainfed environments. It is not common in irrigated rice. It occurs in great numbers during the rainy season.\n\nThe nymphs are active until they molt. The first stay under the body of the adult female and later crawl from plant to plant. They are also dispersed by wind. After dispersal, they stay between the leaf sheath and stem to feed and complete their entire larval development. After molting, the female attaches itself to the plant for life and grows in size.\n\nThe adult females remain stationary and feed while the winged adult male flies off.\n\nThe insect is abundant from April to early July. Two generations are completed during this period.",null,B.m,B.r)
B.JL=new A.aq("\n\nMealybug damage causes: \n\n\u25cf Wilting\n\n\u25cf Plant stunting\n\n\u25cf Yellowish curled leaves\n\n\u25cf damaged spots or chakdhora or soorai disease\n\nIt does not have a uniform pattern of damage.\n\nStunting is also a damage symptom caused by other insect pests like root grubs and rice root aphids. To confirm the cause of damage, check for the presence of insects: \n\n\u25cf Hyaline to yellowish to pinkish eggs\n\n\u25cf Crawlers or nymphs, unwinged pink female adults and winged pale yellow males removing plant sap\n\n\u25cf Appearance of wax covering the eggs, nymphs, and adults that stick on the stem or leaf",null,B.m,B.r)
B.JE=new A.aq("\n\n\u25cf Encourage biological control agents: small encyrtid wasps, spiders, chloropid fly, drosophilid, and lady beetles\n\n\n",null,B.m,B.r)
B.Cg=A.b(s([B.bN,B.Jg,B.b1,B.JF,B.b2,B.JL,B.b0,B.JE]),t.R)
B.Jr=new A.aq(null,B.Cg,B.m,null)
B.JN=new A.aq("\n\nBlast is caused by the fungus Magnaporthe oryzae. It can affect all above-ground parts of a rice plant: leaf, collar, node, neck, parts of panicle, and sometimes leaf sheath.",null,B.m,B.r)
B.Jk=new A.aq("\n\nBlast can occur wherever blast spores are present.\n\nIt occurs in areas with low soil moisture, frequent and prolonged periods of rain showers, and cool temperature in the daytime. In upland rice, large day-night temperature differences that cause dew formation on leaves and overall cooler temperatures favor the development of the disease.\n\nRice can have blast in all growth stages. However, leaf blast incidence tends to lessen as plants mature and develop adult plant resistance to the disease.",null,B.m,B.r)
B.Jp=new A.aq("\n\nCheck the leaf and collar for lesions: \n\n\u25cf Initial symptoms appear as white to gray-green lesions or spots, with dark green borders.\n\n\u25cf Older lesions on the leaves are elliptical or spindle-shaped and whitish to gray centers with red to brownish or necrotic borders.\n\nCheck for other symptoms: \n\n\u25cf Some resemble the diamond shape, wide in the center and pointed toward either end.\n\n\u25cf Lesions can enlarge and coalesce, growing together, to kill the entire leaves.\n\nBlast lesions can commonly be confused with Brown Spot lesions.\n\nLeaf blast lesions are usually elongated and pointed at each end, while brown spot lesions tend to be more round, brown in color, and have a yellow halo surrounding the lesion.",null,B.m,B.r)
B.Jd=new A.aq("\n\nThe primary control option for the blast is to plant resistant varieties. Contact your local agriculture office for up-to-date lists of varieties available.\n\nOther crop management measures can also be done, such as: \n\n\u25cf Adjust planting time. Sow seeds early, when possible, after the onset of the rainy season.\n\n\u25cf Split nitrogen fertilizer application in two or more treatments. Excessive use of fertilizer can increase blast intensity.\n\n\u25cf Flood the field as often as possible.\n\nSilicon fertilizers (e.g., calcium silicate) can be applied to soils that are silicon deficient to reduce blast. However, because of its high cost, silicon should be applied efficiently. Cheap sources of silicon, such as straws of rice genotypes with high silicon content, can be an alternative. Care should be taken to ensure that the straw is free from the blast as the fungus can survive on rice straw and the use of infected straw as a silicon source can spread the disease further.\n\nSystemic fungicides like triazoles and strobilurins can be used judiciously for the control-to-control blast. A fungicide application at the heading can be effective in controlling the disease.\n\n\n",null,B.m,B.r)
B.Ds=A.b(s([B.bN,B.JN,B.b1,B.Jk,B.b2,B.Jp,B.b0,B.Jd]),t.R)
B.Ju=new A.aq(null,B.Ds,B.m,null)
B.Jh=new A.aq("\n\nBacterial blight is caused by Xanthomonas oryzae pv. oryzae.\n\nIt causes wilting of seedlings and yellowing and drying of leaves.",null,B.m,B.r)
B.Je=new A.aq("\n\nThe disease is most likely to develop in areas that have weeds and stubbles of infected plants. It can occur in both tropical and temperate environments, particularly in irrigated and rainfed lowland areas. In general, the disease favors temperatures at 25\u221234\xb0C, with relative humidity above 70%.\n\nIt is commonly observed when strong winds and continuous heavy rains occur, allowing the disease-causing bacteria to easily spread through ooze droplets on lesions of infected plants.\n\nBacterial blight can be severe in susceptible rice varieties under high nitrogen fertilization.",null,B.m,B.r)
B.JO=new A.aq("\n\nCheck for wilting and yellowing of leaves or wilting of seedlings (also called kresek).\n\nOn seedlings, infected leaves turn grayish-green and roll-up. As the disease progresses, the leaves turn yellow to straw-colored and wilt, leading whole seedlings to dry up and die.\n\nKresek on seedlings may sometimes be confused with early rice stem borer damage. \n\nTo distinguish kresek symptoms from stem borer damage, squeeze the lower end of infected seedlings between the fingers. Kresek symptoms should show yellowish bacterial ooze coming out of the cut ends. Unlike plants infested with stem borer, rice plants with kresek are not easily pulled out from the soil.\n\nCheck for lesions: \n\n\u25cf On older plants, lesions usually develop as water-soaked to yellow-orange stripes on leaf blades or leaf tips or on mechanically injured parts of leaves. Lesions have a wavy margin and progress toward the leaf base.\n\n\u25cf On young lesions, bacterial ooze resembling a milky dewdrop can be observed early in the morning. The bacterial ooze, later on, dries up and becomes small yellowish beads underneath the leaf.\n\n\u25cf Old lesions turn yellow to grayish-white with black dots due to the growth of various saprophytic fungi. On severely infected leaves, lesions may extend to the leaf sheath.\n\n\nTo quickly diagnose bacterial blight on leaf: \n\n\u25cf Cut a young lesion across and place in a transparent glass container with clear water\n\n\u25cf After a few minutes, hold the container against light and observe for thick or turbid liquid coming from the cut end of the leaf",null,B.m,B.r)
B.Jv=new A.aq("\n\nPlanting resistant varieties have been proven to be the most efficient, most reliable, and cheapest way to control bacterial blight.\n\nOther disease control options include: \n\n\u25cf Use of balanced amounts of plant nutrients, especially nitrogen.\n\n\u25cf Ensure good drainage of fields (in conventionally flooded crops) and nurseries.\n\n\u25cf Keep fields clean. Remove weed hosts and plow under rice stubble, straw, rice ratoons, and volunteer seedlings, which can serve as hosts for bacteria.\n\n\u25cf Allow fallow fields to dry in order to suppress disease agents in the soil and plant residues.\n\n\n",null,B.m,B.r)
B.Cn=A.b(s([B.bN,B.Jh,B.b1,B.Je,B.b2,B.JO,B.b0,B.Jv]),t.R)
B.JG=new A.aq(null,B.Cn,B.m,null)
B.Jx=new A.aq("\n\nShort-horned grasshopper and Oriental migratory locust both infest the rice plant and have similar feeding damage.",null,B.m,B.r)
B.l0=new A.aq("\n\nWhat It Does",null,B.m,B.dz)
B.Jc=new A.aq("\n\nFeeding damage caused by short-horned grasshoppers and oriental migratory locusts results in cutting out areas on leaves and cut-off panicles. They both feed on leaf margins.",null,B.m,B.r)
B.JZ=new A.aq("\n\nAquatic environments are suitable for the development of short-horned grasshoppers, while locusts may prefer dry environments. Both are favored by the presence of alternate hosts.\n\nThe short-horned grasshoppers are common in moist and swampy areas. These nocturnal insect pests are abundant during September and October.\n\nOriental migratory locusts are commonly found in all rice environments, but they are more concentrated in rainfed areas. They dominate the irrigated rice environment surrounded by grassland breeding grounds. Both the adults and the nymphs are nocturnal and feed on the rice foliage at night. In the daytime, they hide at the base of the plant. Under favorable conditions, the adults swarm and migrate.",null,B.m,B.r)
B.JI=new A.aq("\n\nCheck for feeding damage, such as \n\n\u25cf feeding marks on leaves and shoots,\n\n\u25cf large portions of leaf edges consumed, and\n\n\u25cf cut-off panicles.\n\n\nCheck for insect presence: \n\n\u25cf eggs in pods\n\n\u25cf presence of yellow and brown nymphs and adults feeding on rice foliage\n\nGrasshopper and locust damage can be confused with damage caused by other defoliators. To confirm, find the insect and the characteristic form of leaf damage.",null,B.m,B.r)
B.JA=new A.aq("\n\n\u25cf Flood the stubbles, shave bunds, sweep along the bunds, and pick adults directly from the foliage at night when they are sluggish.\n\n\u25cf Encourage biological control agents: scelionid wasps, parasitic flies, nematodes, and fungal pathogens, birds, frogs, and web-spinning spiders, and a certain species of an entomophthoralean fungus; and platystomatid fly and mite (eggs of oriental migratory locust), ants, birds, bats, field rats, mice, wild pigs, dogs, millipedes, fish, amphibia, reptiles, and monkeys.\n\n\u25cf Use poison baits from salt water and rice bran.\n\n\u25cf Use foliar sprays to control grasshoppers in rice fields. Granules are not effective.\n\n\n",null,B.m,B.r)
B.Cy=A.b(s([B.Jx,B.l0,B.Jc,B.b1,B.JZ,B.b2,B.JI,B.b0,B.JA]),t.R)
B.JH=new A.aq(null,B.Cy,B.m,null)
B.JS=new A.aq("\n\nRice tungro disease is caused by the combination of two viruses, which are transmitted by leafhoppers. It causes leaf discoloration, stunted growth, reduced tiller numbers, and sterile or partly filled grains.\n\nTungro infects cultivated rice, some wild rice relatives, and other grassy weeds commonly found in rice paddies.",null,B.m,B.r)
B.K2=new A.aq("\n\nTungro disease viruses are transmitted from one plant to another by leafhoppers that feed on tungro-infected plants. The most efficient vector is the green leafhopper.\n\nLeafhoppers can acquire the viruses from any part of the infected plant by feeding on it, even for a short time. It can, then, immediately transmit the viruses to other plants within 5\u22127 days. The viruses do not remain in the leafhopper body unless it feeds again on an infected plant and re-acquire the viruses.\n\nTungro infection can occur during all growth stages of the rice plant. It is most frequently seen during the vegetative phase.Plants are most vulnerable at the tillering stage.\n\nTungro incidence depends on the availability of the virus sources and vector population. Other than infected rice plants in the farmers field, other primary sources for tungro, include:\n\n\u25cf Stubble of previous crops\n\n\u25cf New growth from infected stubbles that had not been properly plowed under and harrowed effectively\n\n\u25cf Volunteer rice\n\n\u25cf Infected plants in nearby rice fields\n\nSeedlings raised in nurseries or seedbeds can also be infected with Tungro prior to transplanting and can be a primary source of the virus.\n\nTransplanting seedlings from nurseries in tungro-infected areas has also shown to increase infection rates in the field, particularly, in cases where seedbed is in a tungro-endemic area or when the nursery duration is 5\u22126 weeks.\n\nHowever, this is not believed to be a very strong mechanism in initiating epidemics, because the competitiveness of tungro-infected seedlings is low; they can die rapidly after transplanting.\n\nOnce tungro is present in the field, it increases rapidly in young rice plants. Leafhopper vectors prefer to feed on young rice plants. They also acquire tungro viruses more efficiently from younger infected plants.",null,B.m,B.r)
B.Ji=new A.aq("\n\nCheck for the presence of leafhoppers.\n\nCheck leaves for discoloration.\n\nThe yellow or orange-yellow discoloration is noticeable in tungro-infected plants. Discoloration begins from the leaf tip and extends down to the blade or the lower leaf portion. Infected leaves may also show mottled or striped appearance, rust-colored spots, and interveinal necrosis.\n\nTungro-infected plants also show symptoms of stunting, delayed flowering which may delay maturity, reduced number of tillers, small and not completely exserted panicles, as well as a higher-than-normal percentage of sterile panicles or partially filled grains, covered with dark brown blotches.\n\nThe degree of stunting and of leaf discoloration varies with rice varieties, strains of the viruses, the age of the plant when infected, and with the environment. In varieties that carry some resistance to the disease, infected plants exhibit no discoloration or only a mild discoloration that may disappear as the plants mature. \n\nTungro symptoms can be mistaken for physiological disorders.\n\nSpecifically,\n\n\u25cf The yellowing of the plant and its stunted height can be confused with nitrogen and zinc deficiencies and water stress,\n\n\u25cf Pest infestation such as stem borer infestation, planthopper infestation, rat damage and Other diseases such as grassy stunt virus disease and orange leaf.\n\nWhere available, Tungro can be confirmed using serological tools such as the Latex agglutination test, Enzyme-Linked Immunosorbent Assays (ELISA), and Rapid Immunofilter Paper Assays (RIPA).",null,B.m,B.r)
B.JD=new A.aq("\n\nOnce a rice plant is infected by tungro, it cannot be cured.\n\nPreventive measures are more effective for the control of tungro than direct disease control measures. Using insecticides to control leafhoppers is often not effective, because green leafhoppers continuously move to surround fields and spread tungro rapidly in very short feeding times.\n\nThe most practical measures at present, include\n\n\u25cf Grow tungro or leafhopper resistant varieties.This is the most economical means of managing the disease. There are tungro-resistant varieties available for the Philippines, Malaysia, Indonesia, India, and Bangladesh.Contact your local agriculture office for up-to-date lists of varieties available.\n\n\u25cf Practice synchronous planting with surrounding farms.Delayed or late planting, relative to the average date in a given area, makes the field susceptible for Tungro. Late-planted fields also pose a risk to early planting in the next season.\n\n\u25cf Adjust planting times to when green leafhoppers are not in season or abundant if known\n\n\u25cf Plow infected stubbles immediately after harvest to reduce inoculum sources and destroy the eggs and breeding sites of green leaf hoppers.\n\n\n",null,B.m,B.r)
B.Cl=A.b(s([B.bN,B.JS,B.b1,B.K2,B.b2,B.Ji,B.b0,B.JD]),t.R)
B.JK=new A.aq(null,B.Cl,B.m,null)
B.JW=new A.aq("\n\nSheath blight is a fungal disease caused by Rhizoctonia solani. Infected leaves senesce or dry out and die more rapidly, young tillers can also be destroyed.As a result, the leaf area of the canopy can significantly be reduced by the disease. This reduction in leaf area, along with the diseased-induced senescence of leaves and young infected tillers are the primary causes of yield reduction.\n\n",null,B.m,B.r)
B.Js=new A.aq("\n\nSheath blight occurs in areas with high temperatures (28\u221232\xb0C),  high levels of nitrogen fertilizer, and relative humidity of crop canopy from 85\u2212100%.\n\nPlants are more vulnerable to sheath blight during the rainy season.\n\nHigh seeding rate or close plant spacing, dense canopy, disease in the soil, sclerotia or infection bodies floating on the water, and growing of high yielding improved varieties also favor disease development.",null,B.m,B.r)
B.K0=new A.aq("\n\nSymptoms are usually observed from tillering to the milk stage in a rice crop and include the following: \n\n\u25cf Oval or ellipsoidal greenish-gray lesions, usually 1-3 cm long, on the leaf sheath, initially just above the soil or water level in the case of conventionally flooded rice.\n\n\u25cf Under favorable conditions, these initial lesions multiply and expand to the upper part of the sheaths, the leaves, and then spread to neighboring tillers belonging to different hills (transplanted rice) or plants (direct-seeded rice).\n\n\u25cf Lesions on the leaves usually have irregular lesions, often with gray-white centers and brown margins as they grow older.\n\n\u25cf In subtropical environments, the disease is mostly initiated by sclerotia (up to two million of which can be produced per square meter in a diseased crop).\n\nIn tropical ecosystems, however, the role of sclerotia in initiating the disease is uncertain. In any case, the pathogen does not produce aerially dispersed spores; its dispersal is essentially dependent on hyphae running on plant tissues and producing new infections.\n\nSheath blight has symptoms similar to stem rot and stem borer infestation. To confirm the cause of disease, check for irregular lesions usually found on the leaf sheaths (initially water-soaked to greenish-gray and later becomes grayish-white with a brown margin). Also, check for the presence of sclerotia.",null,B.m,B.r)
B.JU=new A.aq("\n\nThere is currently no resistant rice variety available for cultivation. The main management options available to minimize sheath blight include: \n\n\u25cf Use a reasonable level of fertilizer adapted to the cropping season.\n\n\u25cf Use reasoned density of crop establishment (direct seeding or transplanting).\n\n\u25cf Carefully control weeds, especially on the levees.\n\n\u25cf Drain rice fields relatively early in the cropping season to reduce sheath blight epidemics.\n\n\u25cf Use a fungicide to treat seeds.\n\n\u25cf Improve canopy architecture by reducing seeding rate or providing wider plant spacing.\n\n\n",null,B.m,B.r)
B.De=A.b(s([B.bN,B.JW,B.b1,B.Js,B.b2,B.K0,B.b0,B.JU]),t.R)
B.JQ=new A.aq(null,B.De,B.m,null)
B.Jj=new A.aq("\n\nFalse smut causes chalkiness of grains which leads to a reduction in grain weight. It also reduces seed germination.",null,B.m,B.r)
B.Jy=new A.aq("\n\nThe disease can occur in areas with high relative humidity (>90%) and temperature ranging from 25\u221235 \xbaC.\n\nRain, high humidity, and soils with high nitrogen content also favor disease development. Wind can spread the fungal spores from plant to plant.\n\nFalse smut is visible only after panicle exsertion. It can infect the plant during the flowering stage.",null,B.m,B.r)
B.Jf=new A.aq("\n\nCheck for the presence of velvety smut balls on spikelets.\n\nPlants infected with false smut have individual rice grains transformed into a mass of spore balls. These spore balls are initially orange and then turn into greenish-black when they mature.\n\nIn most cases, not all spikelets of a panicle are affected, but spikelets neighboring smut balls are often unfilled.\n\n\u25cf Individual rice grain transformed into a mass of velvety spores or yellow fruiting bodies\n\n\u25cf Growth of velvety spores enclose floral parts\n\n\u25cf Immature spores slightly flattened, smooth, yellow, and covered by a membrane\n\n\u25cf Growth of spores results to broken membrane\n\n\u25cf Mature spores orange and turn yellowish-green or greenish-black\n\n\u25cf Only a few grains in a panicle are usually infected and the rest are normal",null,B.m,B.r)
B.JB=new A.aq("\n\n\u25cf Keep the field clean.\n\n\u25cf Remove infected seeds, panicles, and plant debris after harvest.\n\n\u25cf Reduce humidity levels through alternate wetting and drying (AWD) rather than permanently flooding the fields.\n\n\u25cf Where possible, perform conservation tillage and continuous rice cropping.\n\n\u25cf Use moderate rates of Nitrogen.\n\n\u25cf Use certified seeds.\n\n\u25cf Resistant varieties have been reported. Contact your local agriculture office for an up-to-date list of available varieties.\n\n\u25cf Treat seeds at 52\xb0C for 10 min.\n\n\n",null,B.m,B.r)
B.D5=A.b(s([B.bN,B.Jj,B.b1,B.Jy,B.b2,B.Jf,B.b0,B.JB]),t.R)
B.JT=new A.aq(null,B.D5,B.m,null)
B.Jo=new A.aq("\n\nBrown spot has been historically largely ignored as one of the most common and most damaging rice diseases.",null,B.m,B.r)
B.Jl=new A.aq("\n\nBrown spot is a fungal disease that infects the coleoptile, leaves, leaf sheath, panicle branches, glumes, and spikelets. \n\nIts most observable damage is the numerous big spots on the leaves which can kill the whole leaf. When infection occurs in the seed, unfilled grains or spotted or discolored seeds are formed. ",null,B.m,B.r)
B.J9=new A.aq("\n\nThe disease can develop in areas with high relative humidity (86\u2212100%) and temperature between 16 and 36\xb0C. It is common in unflooded and nutrient-deficient soil, or in soils that accumulate toxic substances. \n\nFor infection to occur, the leaves must be wet for 8\u221224 hours.\n\nThe fungus can survive in the seed for more than four years and can spread from plant to plant through the air. Major sources of brown spot in the field include: \n\n\u25cf Infected seed, which gives rise to infected seedlings\n\n\u25cf Volunteer rice\n\n\u25cf Infected rice debris\n\n\u25cf Weeds\n\nBrown spot can occur at all crop stages, but the infection is most critical during maximum tillering up to the ripening stages of the crop.",null,B.m,B.r)
B.K4=new A.aq('\n\nCheck for lesions: \n\n\u25cf Infected seedlings have small, circular, yellow-brown or brown lesions that may girdle the coleoptile and distort primary and secondary leaves.\n\n\u25cf Starting at the tillering stage, lesions can be observed on the leaves. They are initially small, circular, and dark brown to purple-brown.\n\n\u25cf Fully developed lesions are circular to oval with a light brown to gray center, surrounded by a reddish-brown margin caused by the toxin produced by the fungi.\n\nOn susceptible varieties, lesions are 5\u221214 mm long which can cause leaves to wilt. On resistant varieties, the lesions are brown and pinhead-sized.\n\nLesions on leaf sheaths are similar to those on the leaves. Infected glumes and panicle branches have dark brown to black oval spots or discoloration on the entire surface.\n\nSpikelets can also be infected. Infection of florets leads to incomplete or disrupted grain filling and a reduction in grain quality. The disease-causing fungi can also penetrate grains, causing "pecky rice", a term used to describe spotting and discoloration of grains.\n\nIn certain rice varieties, brown spot lesions can be mistaken for blast lesions. To confirm, check if spots are circular, brownish, and have a gray center surrounded by a reddish margin.',null,B.m,B.r)
B.Jt=new A.aq("\n\nImproving soil fertility is the first step in managing brown spot. To do this: \n\n\u25cf monitor soil nutrients regularly.\n\n\u25cf apply required fertilizers.\n\n\u25cf for soils that are low in silicon, apply calcium silicate slag before planting.\n\nFertilizers, however, can be costly and may take many cropping seasons before becoming effective. More economical management options include: \n\n\u25cf Use resistant varieties.Contact your local agriculture office for up-to-date lists of varieties available.\n\n\u25cf Use fungicides (e.g., iprodione, propiconazole, azoxystrobin, trifloxystrobin, and carbendazim) as seed treatments.\n\n\u25cf Treat seeds with hot water (53\u221254\xb0C) for 10\u221212 minutes before planting, to control primary infection at the seedling stage. To increase the effectiveness of treatment, pre-soak seeds in cold water for eight hours.\n\n\n",null,B.m,B.r)
B.CN=A.b(s([B.Jo,B.l0,B.Jl,B.b1,B.J9,B.b2,B.K4,B.b0,B.Jt]),t.R)
