B.JX=new A.aq("\nRead More",null,B.m,B.N6)
B.JJ=new A.aq("\n\nArmyworms are caterpillars that attack rice. There are at least three species of armyworm which attack rice in Asia. These are the rice swarming caterpillar, common cutworm, and the rice ear-cutting caterpillar.\n\nA single armyworm egg mass contains hundreds of eggs. Each female lays 800\u22121000 eggs during its lifetime of about one week.",null,B.m,B.r)
B.Jz=new A.aq("\n\nArmyworm feeds on rice by cutting off leaves and young seedlings at the plants base. They can also cut off rice panicles from base.",null,B.m,B.r)
B.JR=new A.aq("\n\nAdult armyworms survive better and produce more eggs when the temperature is at 15\xb0C maximum, and when plants are naturally fertilized. Periods of drought followed by heavy rains, and the presence of alternate hosts also sustain the development of armyworms.\n\nArmyworms are nocturnal.\n\nThe larvae usually feed in the upper portion of the rice canopy on cloudy days or at night; while the adult feeds, mates, and migrates at night and rests in daytime at the base of the plant.\n\nIn dryland fields, armyworm pupa can be found in the soil or at the base of the rice plants. In wetlands, they pupate on the plants or on grassy areas along the field borders.",null,B.m,B.r)
B.JP=new A.aq("\n\nCheck for feeding damage.\n\nArmyworms feed on leaf tips and along leaf margins. When they eat whole leaves, they can remove them completely or leave only the midribs.\n\nArmyworm damage can be mistaken for cutworm feeding. The characteristic form of armyworm damage is leaf removal. To confirm, check for the presence of the insect and its egg mass.",null,B.m,B.r)
B.JM=new A.aq("\n\nFlooding seedbeds are the best defense against armyworms.\n\nTo prevent armyworm infestation: \n\n\u25cf Establish seedbeds far from large areas of weeds.\n\n\u25cf Plow fallow land.\n\n\u25cf Clean the field and remove weeds.\n\n\nTo control: \n\n\u25cf Place ashes in the trenches to make it more difficult for the caterpillars to escape.\n\n\u25cf Place branches around fields to give armyworms a place to congregate where they are easily collected by hand.\n\n\u25cf Avoid killing natural enemies of armyworms such as wasps and spiders.Insecticides should be the last resort for armyworm control.\n\n\n",null,B.m,B.r)
B.C9=A.b(s([B.JJ,B.l0,B.Jz,B.b1,B.JR,B.b2,B.JP,B.b0,B.JM]),t.R)
